import { Component } from "react";

const styles = {
    button:{
        backgroundColor:'#0A283E',
        color:'#fff',
        padding:'15px 20px',
        border:'none',
        borderRadius:'10px',
        cursor:'pointer'
    }
}

class Button extends Component{
    render(){
        return(
            <button {...this.props} style={styles.button}/>
        )
    }
}

export default Button
